query CricketLiveMatchOddsQuery($matchKey: String!) {
  cricket_match_live_match_odds(match_key: $matchKey) {
    match {
      bet_odds {
        automatic {
          decimal {
            team_key
            value
            __typename
          }
          fractional {
            team_key
            value
            numerator
            denominator
            __typename
          }
          __typename
        }
        __typename
      }
      result_prediction {
        automatic {
          percentage {
            team_key
            value
            __typename
          }
          __typename
        }
        __typename
      }
      teams {
        key
        value {
          key
          code
          name
          __typename
        }
        __typename
      }
      meta {
        key
        status
        format
        start_at
        __typename
      }
      __typename
    }
    __typename
  }
}
